DROP TABLE IF EXISTS `syd_nzfarmland`;
CREATE TABLE `syd_nzfarmland` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '类型id',
  `name` char(30) NOT NULL COMMENT '农田名称',
  `price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '卖多少钱',
  `use_lv` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '使用等级',
  `time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建土地时间',
  `mattock` tinyint(4) NOT NULL DEFAULT '1' COMMENT '开荒铁镐',
  `details` text NOT NULL COMMENT '农田的说明',
  `del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '备用',
  `put` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '备用',
  `turn` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '备用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

