DROP TABLE IF EXISTS `syd_nzgoods`;
CREATE TABLE `syd_nzgoods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(25) NOT NULL DEFAULT '' COMMENT '商品名称',
  `title` tinytext NOT NULL COMMENT '描述',
  `time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '时间',
  `g_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '类形 1种子 2特殊种子 3鱼  4特殊鱼',
  `imgpath1` varchar(100) NOT NULL DEFAULT '' COMMENT '图片1',
  `imgpath2` varchar(100) NOT NULL DEFAULT '' COMMENT '图片2',
  `imgpath3` varchar(100) NOT NULL DEFAULT '' COMMENT '图片3',
  `grow_up` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '几天成长',
  `mature` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '第几天成熟',
  `cycle` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '成熟周期',
  `wealthb` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '能收获财富币',
  `numberb` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '能收获数字币',
  `integral` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '能收获积分',
  `lv` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '购买等级要求',
  `direct` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '购买直推要求',
  `team` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '购买团队人数要求',
  `price` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '卖多少钱',
  `everyday` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '每天收益',
  `farmland_rt` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '黄 红 黑 金 池塘',
  `on_goods` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否上架 1上架  2下架',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

